import Login from './components/authentication/login';
import {
  BrowserRouter as Router,
  Routes,
  Route
} from "react-router-dom";

// CSS files.
import 'bootstrap/dist/css/bootstrap.css';

function App() {
  return (
    <Router>
      <Routes>
        <Route
          exact
          path = '/'
          element = {
            <Login />
          }
        />
      </Routes>
    </Router>
  );
}

export default App;
